import React from 'react';

import styles from './Project1.module.css';

import JobScrapperImage1 from '../../assets/LinkedinJobScrapper.JPG'

function Project1() {
    return (
        <React.Fragment>
            <h1>
                <img alt="Back" className={styles["back-button"]} width="25rem" src="https://image.flaticon.com/icons/png/512/60/60577.png"/>
                Job Scrapper
            </h1>
            <div classname={styles['project-div']}>
                <p className={styles["source-code"]}>Source Code (Python): <a rel="noreferrer" target="_blank" href="https://github.com/melihekici/LinkedInJobScrapper">github.com/melihekici</a></p>
                <p className={styles["source-code"]}>Source Code (Java): <a rel="noreferrer" target="_blank" href="https://github.com/melihekici/-LinkedInJobScrapper-Java-">github.com/melihekici</a></p>
                <br/>
                <img alt="Job Scrapper" className={styles["project-paragraph-image"]} src="./jpgs/LinkedinJobScrapper.JPG"/>
                <p className={styles["project-paragraph"]}>This app has been written in Python language and for windows.<br/> It has a basic tkinter GUI which will ask you the Job to be searched and the location.</p>
                <br/>
            </div>
        </React.Fragment>
    );
};

export default Project1;
